import React from "react";

function FetchPage(){
    console.log("호출되니?")
    fetch("http://jsonplaceholder.typicode.com/posts/1")
        .then((response) => response.json())
        .then(res =>  {Fetch.map(dummy => (
            <ul  className="ListDummy" key={(Fetch.name)}>  
                <li> Name: {Fetch.name}</li>
                <li> Email: {Fetch.email}</li>
                <li> Body: {Fetch.body}</li>
            </ul> 
        ))} )
        .catch((error) => console.log("error:", error));
};

export default FetchPage
